import React, { useEffect, useState, useRef } from 'react';
import '../css/clinic.css';

const Clinic = () => {
    const wrapperRef = useRef(null);
    const carouselRef = useRef(null);
    const [isDragging, setIsDragging] = useState(false);
    const [isAutoPlay, setIsAutoPlay] = useState(true);
    let startX, startScrollLeft, timeoutId;

    useEffect(() => {
        const wrapper = wrapperRef.current;
        const carousel = carouselRef.current;
        const firstCardWidth = carousel.querySelector(".card").offsetWidth;
        const arrowBtns = wrapper.querySelectorAll(".wrapper i");
        const carouselChildrens = [...carousel.children];

        let cardPerView = Math.round(carousel.offsetWidth / firstCardWidth);

        carouselChildrens.slice(-cardPerView).reverse().forEach(card => {
            carousel.insertAdjacentHTML("afterbegin", card.outerHTML);
        });

        carouselChildrens.slice(0, cardPerView).forEach(card => {
            carousel.insertAdjacentHTML("beforeend", card.outerHTML);
        });

        carousel.classList.add("no-transition");
        carousel.scrollLeft = carousel.offsetWidth;
        carousel.classList.remove("no-transition");

        arrowBtns.forEach(btn => {
            btn.addEventListener("click", () => {
                carousel.scrollLeft += btn.id == "left" ? -firstCardWidth : firstCardWidth;
            });
        });

        const dragStart = (e) => {
            setIsDragging(true);
            carousel.classList.add("dragging");
            startX = e.pageX;
            startScrollLeft = carousel.scrollLeft;
        }

        const dragging = (e) => {
            if (!isDragging) return;
            carousel.scrollLeft = startScrollLeft - (e.pageX - startX);
        }

        const dragStop = () => {
            setIsDragging(false);
            carousel.classList.remove("dragging");
        }

        const infiniteScroll = () => {
            if (carousel.scrollLeft === 0) {
                carousel.classList.add("no-transition");
                carousel.scrollLeft = carousel.scrollWidth - (2 * carousel.offsetWidth);
                carousel.classList.remove("no-transition");
            } else if (Math.ceil(carousel.scrollLeft) === carousel.scrollWidth - carousel.offsetWidth) {
                carousel.classList.add("no-transition");
                carousel.scrollLeft = carousel.offsetWidth;
                carousel.classList.remove("no-transition");
            }
            clearTimeout(timeoutId);
            if (!wrapper.matches(":hover")) autoPlay();
        }

        const autoPlay = () => {
            if (window.innerWidth < 800 || !isAutoPlay) return;
            timeoutId = setTimeout(() => carousel.scrollLeft += firstCardWidth, 2500);
        }

        autoPlay();
        carousel.addEventListener("mousedown", dragStart);
        carousel.addEventListener("mousemove", dragging);
        document.addEventListener("mouseup", dragStop);
        carousel.addEventListener("scroll", infiniteScroll);
        wrapper.addEventListener("mouseenter", () => clearTimeout(timeoutId));
        wrapper.addEventListener("mouseleave", autoPlay);

        return () => {
            carousel.removeEventListener("mousedown", dragStart);
            carousel.removeEventListener("mousemove", dragging);
            document.removeEventListener("mouseup", dragStop);
            carousel.removeEventListener("scroll", infiniteScroll);
            wrapper.removeEventListener("mouseenter", () => clearTimeout(timeoutId));
            wrapper.removeEventListener("mouseleave", autoPlay);
        };
    }, [isAutoPlay, isDragging]);

    return (
        <>
            <div className="container hero">
                <div className="wrapper hero">
                    <div className="hero-text">
                        <h1>Wayside Psyche Resources Center</h1>
                        <p>"Our focus is Quality Care to our Client's Psychological Core and Cure"</p>
                        <button className="btn-mn">Make an Appointment</button>
                    </div>
                    <div className="hero-img">
                        <img src="img/doctors.png" alt="Doctors" />
                    </div>
                </div>
            </div>
            <div className="container tutorial">
                <div className="wrapper tutorial">
                    <div className="tutorial-text">
                        <p className="big">How to get our service?</p>
                        <p className="small">Just follow these simple steps</p>
                    </div>
                    <div className="tutorial-img">
                        <div className="tut-box"></div>
                        <div className="tut-box"></div>
                        <div className="tut-box"></div>
                    </div>
                </div>
            </div>
            <div className="container services">
                <div className="wrapper services" ref={wrapperRef}>
                    <div className="services-text">
                        <p>WHAT WE <span>PROVIDE</span></p>
                    </div>
                    <div className="services-img" ref={carouselRef}>
                        {/* Your card slider content goes here */}
                    </div>
                </div>
            </div>
            <div className="container appoint">
                <div className="wrapper appoint">
                    <div className="appoint-text">
                        <p>Helping people feel mentally well is a meaningful task.
                            We take pride in providing top-notch mental health care in Santa Maria, Bulacan.
                            Our main goal is to ensure you and your family feel comfortable and supported.</p>
                        <button>Make an Appointment</button>
                    </div>
                </div>
            </div>
            <div className="container aboutUs">
                <div className="wrapper aboutUs">
                    <div className="aboutUs-text">
                        <p>WHO <span>WE ARE</span></p>
                    </div>
                    <div className="aboutUs-img"></div>
                </div>
            </div>
            <div className="container comments"></div>
        </>
    );
};

export default Clinic;
